import React from "react";
import styled from "styled-components";
import { LIElement, LinkContainer, ULElement } from "../Header/style";
import Logo from "../Logo/index";

const HeaderContainer = styled.header`
  width: 100%;
  height: 100%;
  padding: 0;
  margin: 0;
  box-shadow: 0px 5px 5px rgba(0, 0, 0, 0.6);
`;

const LogoContainer = styled.div`
  display: flex;
  padding: 7px;
  display: flex;
  align-items: center;
`;

const ListContainer = styled.div`
  margin-left: 15px;
`;

function Index() {
  return (
    <>
      <HeaderContainer>
        <LogoContainer>
          <Logo />
          <ListContainer>
            <ULElement>
              <LinkContainer to="admin/user">
                <LIElement padding>Home</LIElement>
              </LinkContainer>
              <LIElement padding>
                <LinkContainer to="">Contact</LinkContainer>
              </LIElement>
              <LIElement>
                <LinkContainer to="">tra</LinkContainer>
              </LIElement>
            </ULElement>
          </ListContainer>
        </LogoContainer>
      </HeaderContainer>
    </>
  );
}

export default Index;
